INSERT INTO `content` VALUES ('14', 'Sixth Grade Pet', '5', '2', null, '&lt;h2&gt;&lt;strong&gt;Sixth Grade Pet Evolution Material :&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Pet 6th(2).png&quot; style=&quot;height:600px; width:1016px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;All pets using the same evolution materials (80% success chance) with different possible evolution rate.&amp;nbsp;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;Evolution tree are using normal - Seal Wikia evolution tree&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;pre&gt;\r\n&lt;span class=&quot;marker&quot;&gt;&lt;em&gt;White Knight Valkyrie &amp;amp; Death Knight Valkyrie&amp;#39;s offensive damage increase nerfed to 14% at +9. \r\nAs for Devil Valkyrie and the rest of the pets are giving same status as Seal Wikia.&lt;/em&gt;&lt;/span&gt;&lt;/pre&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;These are the respective materials for all 6th grade pet evolution, for &amp;quot;4 Evolution Materials&amp;quot; can be obtained from Alcanez&amp;nbsp;Instance Dungeon&amp;#39;s Chest.&lt;br /&gt;\r\nChances are according to species (bird species&amp;nbsp;will not be able to evolve to piya&amp;#39;s species)&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Evo Success.jpg&quot; style=&quot;height:201px; width:244px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;1. 4 Leaf Clover&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Silk Carp&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Gold Carp&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Rose&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Carp&lt;/p&gt;\r\n\r\n&lt;p&gt;6. Evolution Gold Carp&lt;/p&gt;\r\n\r\n&lt;p&gt;7. Lucky Card&lt;/p&gt;\r\n\r\n&lt;p&gt;8. Evolution Rock&lt;/p&gt;\r\n\r\n&lt;p&gt;9. Evolution Bone Fragment&lt;/p&gt;\r\n\r\n&lt;p&gt;10. Evolution Talisman&lt;/p&gt;', 'Feature', null, '1');
INSERT INTO `content` VALUES ('17', 'Meet the Staff', '3', '9', null, '&lt;h2&gt;&lt;strong&gt;Introducing The Game Masters&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Game Master Name : GM Eastwood &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Gender : Male&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Field : Management and Support &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Language : English &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Line ID : gm.eastwood &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Game Master Name : GM Ethan&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Gender : Male&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Field :&amp;nbsp;Management and Support&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Language : English &amp;amp; Indonesia&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Contact : gm.ethan&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Game Master Name : GM Jordyn&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Gender : Female&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Field : Event&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Language : English &amp;amp; Indonesia&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Available at 08:00 AM (GMT+8) to 10:00 PM (GMT+8) &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;We will ensure fun, fair, and competitive gameplay !!&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Welcome to Seal Online: Chronicles of Shiltz !! Have Fun !! &lt;/strong&gt;&lt;/p&gt;', 'Guides', null, '1');
INSERT INTO `content` VALUES ('40', 'Costume', '5', '1', null, '&lt;p&gt;Normal Price&amp;nbsp;: 20.000.000 Cegel (Monthly)&lt;/p&gt;\r\n\r\n&lt;p&gt;All the Costumes have 10 attack speed and 10 moving speed status buff or enhancement on character upon usage&lt;/p&gt;\r\n\r\n&lt;p&gt;Please add GM Eastwood on Line (gm.eastwood) / FB Messenger to purchase costume&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Pick your desired costume&lt;/li&gt;\r\n	&lt;li&gt;Put the money on the bank account (it will automatically deducted from your account)&lt;/li&gt;\r\n	&lt;li&gt;Send the desired costume name, ID, and character name to GM Eastwood&lt;/li&gt;\r\n	&lt;li&gt;Costume will be directly sent to your IM Bank once payment were made.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Browse Costumes here :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;https://seal-cos.fandom.com/wiki/Costume_Sets&quot; target=&quot;_blank&quot;&gt;https://seal-cos.fandom.com/wiki/Costume_Sets&lt;/a&gt;&lt;/p&gt;', 'Feature', null, '1');
INSERT INTO `content` VALUES ('15', 'About Us', '3', '8', null, '&lt;h2&gt;&lt;strong&gt;About Us&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nSeal Online: Chronicles of Shiltz is a non-profit server run by volunteers with vision to bring back nostalgic feeling from playing the game and it is not made for business purpose. Seal Online: Chronicles of Shiltz will not receive donations to run the server. We currently work on solution to repay the volunteers&amp;rsquo; in conjunction with maintaining non pay to win aspect in our server, further approaches are to be discussed with players and councils to make sure we are walking together towards the right direction. Our team will devote time and effort to ensure all players can enjoy the fun, fair, and competitive gameplay.&lt;/p&gt;\r\n\r\n&lt;p&gt;To bring this vision into reality, supports from players are needed to create a sustainable market and game environment for everyone. We will be strict to players, communities, or countries that can cause harm to our server. Any kind of hacking, cheats, rules violation will be punished by indefinite ban from our server. Seal Online: Chronicles of Shiltz do not have any responsibility and obligation to answer, giving proof, or executing preventive action in order to maintain its quality.&lt;/p&gt;', 'Guides', null, '1');
INSERT INTO `content` VALUES ('35', 'February Lucky Box', '4', '32', null, '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Celebrating CNY.png&quot; style=&quot;height:600px; width:1016px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Happy Lunar New Year and Valentine Day !!!&lt;/p&gt;\r\n\r\n&lt;p&gt;In this month Seal Online: Chronicles of Shiltz will celebrate through playing and grinding together. All monster now will have a chance to drop a &amp;quot;Lucky Box&amp;quot; for you to open, what&amp;#39;s inside ???&lt;/p&gt;\r\n\r\n&lt;p&gt;Steamed Fancy Carp&lt;br /&gt;\r\nCarp Soup&lt;br /&gt;\r\nGold Carp Pastry&lt;br /&gt;\r\nSilver Carp Pastry&lt;br /&gt;\r\nBronze Carp Pastry&lt;br /&gt;\r\nBox of Chocolate&lt;br /&gt;\r\nLove Lollipop&lt;br /&gt;\r\nIce Water&lt;br /&gt;\r\nMax Red &amp;amp; Blue Potion Amphora&lt;br /&gt;\r\nHigh Red &amp;amp; Blue Potion Amphora&lt;br /&gt;\r\nRed &amp;amp; Blue Potion Amphora&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Seal Online : Chronicles of Shiltz&lt;/p&gt;', 'Event', null, '1');
INSERT INTO `content` VALUES ('16', 'Tournament', '1', '4', null, '&lt;h2&gt;&lt;strong&gt;First Monthly Tournament result :&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;h2&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Congratulation GBLK.png&quot; style=&quot;height:600px; width:1016px&quot; /&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;Note : GBLK earned 12 points out of 12 for winning all the match on their group stage, and beat Pestisida at Final Stage.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Second Monthly Tournament :&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Prize Pool = 150 Million Cegels&amp;nbsp;+ 50% Monthly Costume Purchase&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Current Prize Pool = TBA&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Monthly Tournament.png&quot; style=&quot;height:600px; width:1016px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Requirements :&lt;br /&gt;\r\n&lt;br /&gt;\r\n1. Team&amp;#39;s roster&amp;nbsp;consists of 6&amp;nbsp;Players and play a different 2nd Job character&lt;/p&gt;\r\n\r\n&lt;p&gt;2. All Players has to have at least one&amp;nbsp;character above level 150 to participate.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Team has to be from the same guild.&lt;/p&gt;\r\n\r\n&lt;p&gt;4. All Seal CoS rules and terms are applied during tournament, violation means disqualification and permanent ban from the tournament.&lt;/p&gt;\r\n\r\n&lt;p&gt;5. All Participants need to share this post in facebook in&amp;nbsp;order to register for the tournament.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Special Features :&lt;br /&gt;\r\n&lt;br /&gt;\r\n1. Equipments and Characters are prepared by the Seal Online CoS Team and are equal between teams.&lt;/p&gt;\r\n\r\n&lt;p&gt;2. All character will have the same Level, Fame, Equipment, and Pet.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Meta, changes, and alterations are all according to the Seal Online: Chronicles of Shiltz feature.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Rewards :&lt;br /&gt;\r\n&lt;br /&gt;\r\nChampion : 80&amp;nbsp;Million Cegels&amp;nbsp;+ 50% Costume Selling Revenue&lt;/p&gt;\r\n\r\n&lt;p&gt;Runner-Up : 40 Million Cegels&amp;nbsp;+ 25% Costume Selling Revenue&lt;/p&gt;\r\n\r\n&lt;p&gt;3rd Place : 20 Million Cegels&amp;nbsp;+ 15% Costume Selling Revenue&lt;/p&gt;\r\n\r\n&lt;p&gt;Short Video Contest Winner : 10 Million Cegels&amp;nbsp;+ 10% Costume Selling Revenue&lt;br /&gt;\r\n&lt;br /&gt;\r\nRegistration Deadline :&lt;br /&gt;\r\n&lt;br /&gt;\r\nComing Soon&lt;br /&gt;\r\n&lt;br /&gt;\r\nSchedule :&lt;/p&gt;\r\n\r\n&lt;p&gt;Coming Soon&lt;/p&gt;\r\n\r\n&lt;p&gt;Rules :&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Players are not allowed to have any item both in their inventory and bank, except for items that is stored by Game Master.&lt;br /&gt;\r\n2. Umpire will be taken from other teams that do not have match on the corresponding day, 1 Umpire for each team.&lt;br /&gt;\r\n3. Players are not allowed to leave the meeting location by any means.&lt;br /&gt;\r\n4. Items&amp;nbsp;prepared per match are : 300 Red Potion, 300 Medium Red Potion, 300 Max Red Potion, 300 Bronze Carp, 300 Silver Carp, 300 Gold Carp, 300 Blue Potion, 300 Medium Blue Potion, 300 Max Blue Potion, and 300 Bouncy Ball&amp;nbsp;(only for jesters).&lt;br /&gt;\r\n5. Equipment and pets are not allowed to be changed / adjusted, any violation will cause disqualification of a team and banishment from the server.&lt;br /&gt;\r\n6. Match Duration&amp;nbsp;: First 30 kills /&amp;nbsp;8 Minutes.&lt;br /&gt;\r\n7. Match System : Deathmatch, Free Respawn, any skills are allowed to be used.&lt;br /&gt;\r\n8. Players are not allowed to stay in enemy&amp;#39;s base for more than 5&amp;nbsp;seconds.&lt;br /&gt;\r\n9. Disconnect will resulting in game pause, please return to your base immediately and tell your umpire, kill points - loss count will be continued on the next match.&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;', 'Ranking', null, '1');
INSERT INTO `content` VALUES ('18', 'Couple Rank', '1', '3', 'https://seal-cos.com/coupleRank', '', null, null, '1');
INSERT INTO `content` VALUES ('19', 'Download', '3', '10', null, '&lt;h2&gt;How to Download the Client&lt;/h2&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Register on the website and follow through all the procedures.&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Login in the website once your id activated.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. The download link will be on the same location where &amp;quot;Login&amp;quot; button is located after you logged in.&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Ask our support team if you need help in troubleshooting the client.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Seal Online: Chronicles of Shiltz&lt;/p&gt;', 'Guides', null, '1');
INSERT INTO `content` VALUES ('20', 'Daily Event', '4', '25', null, '&lt;h1&gt;&lt;strong&gt;Daily Event Schedule&lt;/strong&gt;&lt;/h1&gt;\r\n\r\n&lt;p&gt;Note : please join our LINE Lounge for latest updates regarding any change of daily event schedule.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;big&gt;Monday&lt;/big&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Event (1) : GM Quest Center + GM Riddle&lt;/strong&gt;&lt;br /&gt;\r\nTime : 21.30 - 23.00 GMT +8&amp;nbsp;&lt;br /&gt;\r\nHost : GM Ethan&lt;br /&gt;\r\nReward : High Quest (1,200 IM Coins), Low Quest (600 IM Coins) &amp;amp; Riddle (1,500 IM Coins)&lt;br /&gt;\r\nNumber of winners : Unlimited (GM Quest Center) &amp;amp; 3 Players (GM Riddle)&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- Get the items GMs ask, you need to submit the item within the time limit (one hour)&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Event (2) : Jumble Rumble&lt;/strong&gt;&lt;br /&gt;\r\nTime : 22.00 - 00.00 GMT +8&lt;br /&gt;\r\nHost : GM Ethan&lt;br /&gt;\r\nReward : Max reward (1,000), Min reward (250)&lt;br /&gt;\r\nNumber of winners : Unlimited (5 rounds)&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- Players will be divided to 4 teams&lt;br /&gt;\r\n- There will be survivor and hunter team each round, and players need to hunt each other or survive&lt;br /&gt;\r\nIf there are more than a quarter amount of total survivors, survivor win the round&lt;br /&gt;\r\nIf there are less than a quarter amount of total survivors, survivor lose the round&lt;br /&gt;\r\n- Each loss will reduce initial amount (1,000) by 150 points&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Event (3) : Battle Royale&lt;/strong&gt;&lt;br /&gt;\r\nTime : 22.00 - 00.00 GMT +8&lt;br /&gt;\r\nHost : GM Ethan&lt;br /&gt;\r\nReward : Participants (400 coins)&lt;br /&gt;\r\n4th Place Winner (additional 15 Lollipop, 15 Ice Water and 15 Chocolate)&lt;br /&gt;\r\n3rd Place&amp;nbsp;Winner (50&amp;nbsp;Lollipop,&amp;nbsp;&amp;nbsp;50 Ice Water and 50&amp;nbsp;Chocolate + 800 coins)&amp;nbsp;&lt;br /&gt;\r\n2nd Place&amp;nbsp;Winner (100&amp;nbsp;Lollipop, 100 Ice Water and 100 Chocolate + 1,200 coins)&amp;nbsp;&lt;br /&gt;\r\n1st Place&amp;nbsp;Winner (200 Lollipop, 200 Ice Water and 200 Chocolate + 1,600 coins)&amp;nbsp;&lt;br /&gt;\r\nNumber of winners : Single Tournament based&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- Form&amp;nbsp;a team of 3 (without duplicate 2nd job), and be the strongest among the rest of Shiltianz&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Event (4) : Hide and Seek&lt;/strong&gt;&lt;br /&gt;\r\nTime : 21.00 - 22.00 GMT +8&lt;br /&gt;\r\nHost : GM Ethan&lt;br /&gt;\r\nReward : 1,500 IM Coins&lt;br /&gt;\r\nNumber of winners :&amp;nbsp;3 winners for each round (5 rounds)&amp;nbsp;&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- Classic hide and seek, get the clues of the map and find the GMs who hide in their most creative way&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Event (5) : Last Man Standing&lt;/strong&gt;&lt;br /&gt;\r\nTime : 21.00 - 22.00 GMT +8&lt;br /&gt;\r\nHost : GM Ethan&lt;br /&gt;\r\nReward : 1,500 IM Coins&lt;br /&gt;\r\nNumber of winners :&amp;nbsp;3 winners for each round (5 rounds)&amp;nbsp;&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- Save yourself from the Mightiest Bosses, ever!!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;big&gt;Tuesday&lt;/big&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Event : Alcanez Instant Dungeon&lt;/strong&gt;&lt;br /&gt;\r\nTime : 17.00 - 00.30 GMT +8&lt;br /&gt;\r\nHost : GM Ethan&lt;br /&gt;\r\nReward : Alcanez Chest (from Bosses)&lt;br /&gt;\r\nNumber of participants : Min number : 3 Players each team &amp;amp; max number: 6 Players each team&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- You need to be at least level 150 to enter the dungeon (level 180 for dungeon number 2)&lt;br /&gt;\r\n- Time limit for each team is one hour and 15 minutes&lt;br /&gt;\r\n- Please join Players Lounge to register for Alcanez. Registration will be opened daily before the Alcanez start.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;big&gt;Wednesday&lt;/big&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Event&amp;nbsp;: Speed Scrabble&lt;/strong&gt;&lt;br /&gt;\r\nTime : 22.00 - 23.00 GMT +8&lt;br /&gt;\r\nHost : GM Jordyn&lt;br /&gt;\r\nReward : 1,000 IM Coins&lt;br /&gt;\r\nNumber of winners : 2 Players each round (10 rounds)&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- Solve GM&amp;#39;s Scrabble before other players.&lt;br /&gt;\r\n-&amp;nbsp;You need to enter a chat room which password is the scrabble&amp;#39;s answer (no space, normal font)&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;big&gt;Thursday&lt;/big&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Event&amp;nbsp;: Fortune Dice&lt;/strong&gt;&lt;br /&gt;\r\nTime : 22.00 - 23.30 GMT +8&lt;br /&gt;\r\nHost : GM Jordyn&lt;br /&gt;\r\nReward : vary between 50&amp;nbsp;to 1,250&amp;nbsp;IM Coins (list to be found on LINE Lounge)&lt;br /&gt;\r\nNumber of winners : Unlimited&amp;nbsp;(1&amp;nbsp;round)&amp;nbsp;&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- Toss a&amp;nbsp;dice and see if you&amp;#39;re a lucky man... or not!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;big&gt;Friday&lt;/big&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Event (1) : War Zone&lt;/strong&gt;&lt;br /&gt;\r\nTime : 22.00 - 00.00 GMT +8&lt;br /&gt;\r\nHost : GM Team&lt;br /&gt;\r\nReward : Winner (1,000) &amp;amp;&amp;nbsp;Participant (500)&lt;br /&gt;\r\nNumber of winners : Unlimited&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- Shiltianz will be divided to two teams. Which team is the strongest for&amp;nbsp;the week?&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Event (2) : Attack On Titan&lt;/strong&gt;&lt;br /&gt;\r\nTime : 22.00 - 00.00 GMT +8&lt;br /&gt;\r\nHost : GM Team&lt;br /&gt;\r\nReward : Winner (1,000) &amp;amp;&amp;nbsp;Participant (500)&lt;br /&gt;\r\nNumber of winners : Unlimited&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- Shiltianz will be divided to two teams to kill Titans. Team which can kill all of bosses first win. PVP and PVE is on!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;big&gt;Saturday &amp;amp; &lt;/big&gt;&lt;big&gt;Sunday&lt;/big&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Event : Ranked Match&lt;/strong&gt;&lt;br /&gt;\r\nTime : Anytime on weekend (Sat &amp;amp; Sun)&lt;br /&gt;\r\nHost : GM Eastwood&lt;br /&gt;\r\nReward : Ranked Match Gacha (500 chances of different rewards, please check LINE Lounge)&lt;br /&gt;\r\nNumber of winners : 20&amp;nbsp;winners each 4 weeks (monthly)&lt;br /&gt;\r\nHow to play :&lt;br /&gt;\r\n- Which guild is the strongest in Shiltz? Get ready for Guild vs Guild war.&lt;/p&gt;', 'Event', null, '1');
INSERT INTO `content` VALUES ('24', 'Players Lounge - LINE', '2', '4', null, '&lt;p&gt;Join our&amp;nbsp;Forum (Lounge) on LINE to get most updated information regarding Seal CoS&lt;br /&gt;\r\n&lt;br /&gt;\r\n1. Please add LINE ID : gm.eastwood on LINE messenger.&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Request to join group.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Invitations will be sent.&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Don&amp;#39;t forget to read the rules and be a good community member.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Seal Online: Chronicles of Shiltz&lt;/p&gt;', 'Community', null, '1');
INSERT INTO `content` VALUES ('25', 'Live Chat - Discord', '2', '5', null, '&lt;p&gt;To join our Discord&lt;br /&gt;\r\nPlease use this Link and make sure to connect with other players&lt;/p&gt;\r\n\r\n&lt;p&gt;Link :&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;https://discord.gg/WDQqpcv&lt;br /&gt;\r\n&lt;br /&gt;\r\nLet&amp;#39;s have fun in Seal CoS Community.&lt;/p&gt;\r\n\r\n&lt;p&gt;Seal Online: Chronicles of Shiltz&lt;/p&gt;', 'Community', null, '1');
INSERT INTO `content` VALUES ('33', 'Ordinary Golden Chest', '4', '31', null, '&lt;h2&gt;Ordinary Golden Chest :&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Ordinary Golden Chest Latest.png&quot; style=&quot;height:600px; width:1016px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Price : 5 M Cegel&lt;/p&gt;\r\n\r\n&lt;p&gt;What&amp;rsquo;s inside Ordinary Golden Chest :&lt;/p&gt;\r\n\r\n&lt;p&gt;Money Bag 150,000 Cegel&lt;br /&gt;\r\nRefinement Manual (G)15&lt;br /&gt;\r\nRefinement Manual (G)16&lt;br /&gt;\r\nCrystal&lt;br /&gt;\r\nRuby&lt;br /&gt;\r\nDiamond&lt;br /&gt;\r\nPink Diamond&lt;br /&gt;\r\n7 Elemental Stones&lt;br /&gt;\r\nGold Rune Stone&lt;br /&gt;\r\nSoul Rune Stone&lt;br /&gt;\r\nNothing&lt;/p&gt;\r\n\r\n&lt;p&gt;Golden Chest Key price is 500 coins&lt;br /&gt;\r\nOrdinary Golden Chest can be bought from NPC Merchant&lt;/p&gt;', 'Event', null, '1');
INSERT INTO `content` VALUES ('32', 'Special Golden Chest', '4', '30', null, '&lt;h2&gt;Special Golden Chest :&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Special Golden Chest Latest.png&quot; style=&quot;height:600px; width:1016px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Price : 50 M Cegel&lt;/p&gt;\r\n\r\n&lt;p&gt;What&amp;rsquo;s inside Special Golden Chest :&lt;/p&gt;\r\n\r\n&lt;p&gt;Money Bag 1 M Cegel&lt;br /&gt;\r\nRefinement Manual (G)15&lt;br /&gt;\r\nRefinement Manual (G)16&lt;br /&gt;\r\n4 Sixth Grade Pet Evolution&amp;nbsp;Materials&lt;br /&gt;\r\nKnight&amp;rsquo;s Fireball&lt;br /&gt;\r\nGambler&amp;rsquo;s Fireball &lt;em&gt;*Jester Fireball changed to Gambler&amp;#39;s Fireball (not for assassin)&lt;/em&gt;&lt;br /&gt;\r\nMage&amp;rsquo;s Fireball&lt;br /&gt;\r\nWarrior&amp;rsquo;s Fireball&lt;br /&gt;\r\nCraftman&amp;rsquo;s Fireball&lt;br /&gt;\r\nPriest&amp;rsquo;s Fireball&lt;br /&gt;\r\nAmariel Wings&lt;br /&gt;\r\nWooden Wings&lt;br /&gt;\r\nDark Wooden Wings&lt;br /&gt;\r\nChirp Chirp Candy&lt;br /&gt;\r\nBrick Hat&lt;br /&gt;\r\n3 Dragon Scale Ticket&lt;br /&gt;\r\n3 Dragon Claw Ticket&lt;br /&gt;\r\nNothing&lt;/p&gt;\r\n\r\n&lt;p&gt;Golden Chest Key price is 500 coins&lt;br /&gt;\r\nSpecial Golden Chest can be bought from NPC Merchant&lt;/p&gt;', 'Event', null, '1');
INSERT INTO `content` VALUES ('34', 'Frequently Asked Question', '3', '11', null, '&lt;h3&gt;Frequently Asked Question :&lt;/h3&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;strong&gt;What should I do to join the community hub?&lt;/strong&gt;&lt;br /&gt;\r\n	We use&amp;nbsp;LINE for our main Forum, we suggest you to join there to get the latest information. Please send a message on LINE to&amp;nbsp;GM Eastwood or GM Ethan and they will invite you.&lt;br /&gt;\r\n	We also have Facebook Lounge where you can find other players and discuss about the game.&lt;br /&gt;\r\n	You can also engage in live discussion on our discord. (&lt;a href=&quot;http://seal-cos.com/browse/25&quot;&gt;link&lt;/a&gt;)&lt;br /&gt;\r\n	&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Where can I buy Guardian (Vroomy)?&lt;/strong&gt;&lt;br /&gt;\r\n	You can buy them in NPC Merchant for 12,000 cegels.&lt;br /&gt;\r\n	&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;How can I get Item Mall coins?&lt;/strong&gt;&lt;br /&gt;\r\n	You can only get Item Mall coins through Daily / Monthly Events.&lt;br /&gt;\r\n	The schedule for Daily Event is available &lt;a href=&quot;http://seal-cos.com/browse/20&quot;&gt;here&lt;/a&gt;.&lt;br /&gt;\r\n	&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Is Auto Hunt allowed here?&lt;/strong&gt;&lt;br /&gt;\r\n	No.&lt;br /&gt;\r\n	Doing Auto Hunt will cause you a permanent ban.&lt;br /&gt;\r\n	&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Why&amp;nbsp;can&amp;#39;t I find&amp;nbsp;Gaius Item Mall?&lt;/strong&gt;&lt;br /&gt;\r\n	We don&amp;#39;t sell such item which will support Auto Hunt abuse.&lt;br /&gt;\r\n	&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Where is the main town?&lt;/strong&gt;&lt;br /&gt;\r\n	It&amp;#39;s in Elim. You can find other players open vending stalls there.&lt;br /&gt;\r\n	&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;What is Bug Buff?&lt;/strong&gt;&lt;br /&gt;\r\n	A bug which last longer than usual buff.&lt;br /&gt;\r\n	You can apply one by giving a character solo buffs, and top it with party buff immediately.&lt;br /&gt;\r\n	The buff will last on your status (press T on keyboard)&lt;br /&gt;\r\n	The buff won&amp;#39;t disappear as long as you don&amp;#39;t disconnect, move to another map or getting same buff after the bug was made.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h3&gt;Here are questions we have collected from Seal CoS players&lt;/h3&gt;\r\n\r\n&lt;p&gt;You can ask questions regarding Seal CoS to us GM staffs and Seal CoS Higher Ups.&lt;br /&gt;\r\nWe will choose 1 or 2 interesting questions every week and answer it through @gamemaster.sealcos (Instagram) and Seal CoS page (Facebook)&lt;/p&gt;\r\n\r\n&lt;p&gt;You can put your questions on link available on LINE Lounge.&lt;/p&gt;\r\n\r\n&lt;p&gt;For players whose questions are used will get coins reward.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Q1.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/A1.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Q2.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/A2.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Q3.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/A3.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Q4.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/A4.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Q5.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/A5.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Q6.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/A6.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Q7.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/A7.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Q8.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/A8.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Q9.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/A9.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/QA 10.png&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;', 'Guides', null, '1');
INSERT INTO `content` VALUES ('37', 'Starter Guide', '3', '12', null, '&lt;p&gt;Welcome to Seal Online : Chronicles of Shiltz !!&lt;br /&gt;\r\n&lt;br /&gt;\r\nRegistration :&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;You can register &lt;a href=&quot;http://seal-cos.com/register&quot;&gt;here&lt;/a&gt;&amp;nbsp;.&lt;/li&gt;\r\n	&lt;li&gt;Please wait for GM Team&amp;nbsp;to review&amp;nbsp;your ID. Don&amp;#39;t forget to send a picture of your ID Card to Official LINE&amp;nbsp;@seacos. Thank you for your patience! It is usually done in 24 hours.&lt;/li&gt;\r\n	&lt;li&gt;Referral Code is made by players who are playing in Seal CoS.&amp;nbsp;You can put their code, so we would know that you got to know us from them.&lt;br /&gt;\r\n	If you discovered us from another source, (e.g. instagram / facebook page) you can put it just as it is.&lt;/li&gt;\r\n	&lt;li&gt;If you have some technical trouble in launching the game for the first time, don&amp;#39;t be hesitated to contact us for help.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nEntering Shiltz For The First Time :&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;You will find 500,000 Cegel pocket money on your bank account.&lt;/li&gt;\r\n	&lt;li&gt;To get connected with another players, we suggest you to join our LINE Lounge (messaging application) for forum and traing group&lt;br /&gt;\r\n	And to have a live conversation, please join our Discord channel!&amp;nbsp;&lt;br /&gt;\r\n	LINE Lounge :&amp;nbsp;&lt;a href=&quot;http://seal-cos.com/browse/24&quot;&gt;here&lt;/a&gt; (please contact gm eastwood)&lt;br /&gt;\r\n	Discord Channel :&amp;nbsp;&lt;a href=&quot;http://seal-cos.com/browse/25&quot;&gt;here&lt;/a&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Grinding Advice :&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/Quest Reward.png&quot; style=&quot;height:472px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Grind as much as you can to get much more cegel for you to survive !! Some quest rewards are altered so you can earn more.&lt;/li&gt;\r\n&lt;/ul&gt;', 'Guides', null, '1');
INSERT INTO `content` VALUES ('38', 'Seal COS GM Support', '2', '6', null, '&lt;p&gt;Reach us anytime using LINE&amp;nbsp;if you have any&amp;nbsp;question regarding our game&lt;br /&gt;\r\nWe will also deliver any updates and news about Seal Online : Chronicles of Shiltz&lt;/p&gt;\r\n\r\n&lt;h3&gt;Official LINE&amp;nbsp;Account :&lt;/h3&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;@sealcos (using @)&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/step 1.png&quot; style=&quot;height:355px; width:373px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/step 2.png&quot; style=&quot;height:381px; width:360px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/step 3.png&quot; style=&quot;height:513px; width:308px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://seal-cos.com/public/picture/step 4.png&quot; style=&quot;height:584px; width:334px&quot; /&gt;&lt;/p&gt;', 'Community', null, '1');
INSERT INTO `content` VALUES ('41', 'Troubleshooter', '3', '13', null, '&lt;p&gt;&lt;strong&gt;==Game Shield Problem Troubleshooting==&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Please do the following step so you can run the game :&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Put Seal Folder under Antivirus, Windows Firewall and Windows Defender&amp;rsquo;s Exclusion List&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Locate So3D, UGK Loader, and Seal Online: Chronicles of Shiltz Launcher on your Seal Online folder&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Right-click, properties, Check the &amp;quot;run as administrator&amp;quot; box (do it to all 3 application)&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Check the Run as administrator box&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Restart your PC, Internet Router, and try to launch the game.&lt;/p&gt;\r\n\r\n&lt;p&gt;6. If still doesn&amp;#39;t work, delete all files inside your seal folder , do not delete the main folder.&lt;/p&gt;\r\n\r\n&lt;p&gt;7. Reinstall on the main folder and do Step 2 to 5&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;==Crash Loading Troubleshooting==&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;(A) Please do the following steps :&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Change resolution to the maximum your computer allow in launcher&amp;#39;s setting&lt;br /&gt;\r\n2. Run as Fullscreen&lt;/p&gt;\r\n\r\n&lt;p&gt;(B)&amp;nbsp;If this doesn&amp;#39;t solve the problem, try :&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Open your Seal Cos Folder&lt;br /&gt;\r\n2. Locate So3D&lt;br /&gt;\r\n3. Right-click, properties, Check the &amp;quot;run as administrator&amp;quot; box&lt;/p&gt;\r\n\r\n&lt;p&gt;NOTE : There are 3 reason why that can happen :&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Your computer doesn&amp;#39;t support the resolution&lt;br /&gt;\r\n2. Your computer needs escalation of users account to run the program&lt;br /&gt;\r\n3. Installation incomplete (Download the latest client on the website)&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;strong&gt;==Folder Exclusions==&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Please refer to the link below to exclude your Seal CoS folder from windows defender.&lt;/p&gt;\r\n\r\n&lt;p&gt;This would save your seal from getting scanned.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;https://support.microsoft.com/en-sg/help/4028485/windows-10-add-an-exclusion-to-windows-defender-antivirus&quot;&gt;link&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;strong&gt;==Add an allowed app==&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Please refer to the link below and choose &amp;ldquo;ALL&amp;rdquo; of your Seal CoS application/program found when searching inside your Seal CoS folder.&lt;/p&gt;\r\n\r\n&lt;p&gt;This would allow you to run seal program safely.&lt;/p&gt;\r\n\r\n&lt;p&gt;https://www.tenforums.com/tutorials/113430-add-remove-allowed-apps-controlled-folder-access-windows-10-a.html&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;==Dual Login==&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;(A) For those who experienced trouble during dual login usage :&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Turn off Windows defender and Antivirus&lt;br /&gt;\r\n2. Delete ver.dat on Seal Folder&lt;br /&gt;\r\n3. Repatch&lt;br /&gt;\r\n4. Open client and Login 1st ID&lt;br /&gt;\r\n5. Open 2nd client and Login 2nd ID&lt;/p&gt;\r\n\r\n&lt;p&gt;(B) If you keep get disconnected when launch 2nd Launcher, try :&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Open Control Panel&lt;br /&gt;\r\n2. Choose Security and Maintenance, Change User Account Control Settings&lt;br /&gt;\r\n3. On the &amp;quot;Choose when tho be notified about changes to your computer&amp;quot;, choose Never Notify (the lowest bar)&lt;/p&gt;\r\n\r\n&lt;p&gt;One PC can launch maximum 3 Launcher at the same time. More than that, everything will be disconnected.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;Important Note : Beware of the IP ban, do not login together. Wait at least 30 seconds until you login the 2nd ID&lt;/em&gt;&lt;/p&gt;', 'Guides', null, '1');
