INSERT INTO `news` VALUES ('21', 'Seal Online : Chronicles of Shiltz', 'Welcome to Seal Online: Chronicles of Shiltz.\r\n\r\nWe are self-sustained private server which developed for Seal Lovers and not relying on donations to emphasize fair and fun. Say No to Pay to Win !!\r\n \r\nCome and Join Us !!\r\n\r\nServer Bonus Rate Status \r\nMay 3rd-10th, 2019 :\r\n\r\nExp : 200%\r\nDrop : 100%', 'image_news21.jpg', '1');
INSERT INTO `news` VALUES ('3', 'Alteration of Quests Reward', 'Reward for quests are altered for grinding purpose,\r\nGet ready and hunt those bales.\r\nQuests are available in quest center.\r\nInvest in your dreams. Grind now. Shine later.\r\n\r\nSeal Online: Chronicles of Shiltz', 'image_news3.png', '1');
INSERT INTO `news` VALUES ('4', 'Sixth Pet Grade Evolution are Now Available', 'It is time for those pets to reach new level, train them and conquer all those bales. 6th grade pet evolution are now available.\r\nYou are chosen to wear them, they will only chose those above level 200 to be their master. Train, Bond, and Shine !!!!', 'image_news4.png', '1');
INSERT INTO `news` VALUES ('5', 'Weekly Maintenance Schedule', 'Server will be turned off at 13:00 - 18:00 PM (GMT+8) every Friday for weekly maintenance. Please log out to avoid unnecessary problems.\r\n\r\nRegistration and GM Support will be put on hold, we will continue to serve you after maintenance ends.', 'image_news5.png', '1');
INSERT INTO `news` VALUES ('15', 'Priest Buff Help', 'hi, are you a new player? do you need help with buff?\r\n\r\nAdrian (60) Benedict (90), Cedric (150), and Darren (200)\r\n\r\nThey will be available to help you, mostly at 17:00 - 00:00 PM\r\n\r\nhigh priority for player who are level less than 120 can send GM Ethan (LINE : gm.ethan) a LINE message\r\n\r\nWe will try our best to serve you guys!', 'image_news15.png', '1');
